import React, { Component } from "react";
import { Button, Card } from "semantic-ui-react";
import Layout from "../../components/Layout";

class MailList extends Component {

  renderList() {
    const items = [
      {
        meta: "받으시는분",
        header:"이름: ",
        description:"주소: "
      },
      {
        description:"받으시는분: ",
        description:"이름: ",
      },
      {
        description:"받으시는분: ",
        description:"이름: ",
      },
    ]

    return <Card.Group items={items} />;
  }

  render() {
    return (
      <Layout>
        <div>
          <Button type="submit" basic color="violet" floated="right">
            택배 접수
          </Button>
        </div>
        <div>
          {this.renderList()}
        </div>
      </Layout>
    );
  }
}

export default MailList;
